function Accordeons({ title, content }) {
  return (
    <div style={{ display: "flex", flexDirection: "column", width:500}}>
      <span
        style={{
          backgroundColor: "#FF6060",
          padding: "10px 10px",
          borderRadius: 10,
          color: "white",
          position: "relative",
          zIndex: 10,
        }}
      >
        {title}
      </span>
      <span
        style={{
          backgroundColor: "#F6F6F6",
          padding: "10px 10px",
          borderBottomLeftRadius: 10,
          color: "#FF6060",
          borderBottomRightRadius: 20,
          position: "relative",
          top: -10,
          paddingTop: 20,
        }}
      >
        {content}
      </span>
    </div>
  );
}

export default Accordeons;
